//Import the Link API
import Link from 'next/Link';

import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Dropdown from 'react-bootstrap/Dropdown';

import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faHome, faGlobe } from '@fortawesome/free-solid-svg-icons';

const linkStyle = {
  fontSize: '15px',
  marginTop: '0px',
  color: 'ghostwhite',
};

const navStyle = {
  backgroundColor: 'slategrey'
};

export default () => (
            <Navbar style={navStyle} >

              <Link href='/'>
                <Nav.Link as='a' href='/' style={linkStyle} >
                  <FontAwesomeIcon icon={faHome} /> HOME
                </Nav.Link>
              </Link>

              <Dropdown as={Nav.Link} >
                  <Dropdown.Toggle as='a' style={linkStyle}>
                      <FontAwesomeIcon icon={faGlobe} /> FILTER...
                  </Dropdown.Toggle>
                  <Dropdown.Menu>
                      <Link href='/europe' >
                          <Dropdown.Item href='/europe' >EUROPE</Dropdown.Item>
                      </Link>
                      <Link href='/africa' >
                          <Dropdown.Item href='/africa' >AFRICA</Dropdown.Item>
                      </Link>
                                            {/* </Link> */}
                      <Link href='/americas' >
                          <Dropdown.Item href='/americas' >AMERICAS</Dropdown.Item>
                      </Link>
                </Dropdown.Menu>
              </Dropdown>

              <Link href='/about'>
                <Nav.Link as='a' href='/about' style={linkStyle} >
                  ABOUT
                </Nav.Link>
              </Link>

        </Navbar>
);

<Dropdown>
  <Dropdown.Toggle variant="success" id="dropdown-basic">
    Dropdown Button
  </Dropdown.Toggle>

  <Dropdown.Menu>
    <Dropdown.Item href="#/action-1">Action</Dropdown.Item>
    <Dropdown.Item href="#/action-2">Another action</Dropdown.Item>
    <Dropdown.Item href="#/action-3">Something else</Dropdown.Item>
  </Dropdown.Menu>
</Dropdown>
